import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { viewBook } from '../redux/bookTypes'

 const Bookings = () => {
    const userId = useSelector( state => state.userTokener._userId )
    const bookings = useSelector( state => state.book.bookings )
    if(bookings)
    console.log("bookings : ",bookings[0].movie.movieName)
    const dispatch = useDispatch()
    useEffect(() => {
      dispatch(viewBook(userId))
    },[userId])
    return(<>
      Bookings Page
      { bookings && bookings.map( book => <p>{book.movie.moviName}</p>) }
    </>)
 }

 export default Bookings
